import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import MainPage from './MainPage'; // Importuj komponent MainPage

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [username, setUsername] = useState('');

  const handleLogin = (username) => {
    // Dodaj logikę logowania
    setUsername(username);
    setIsLoggedIn(true);
  };

  const handleLogout = () => {
    // Dodaj logikę wylogowania
    setIsLoggedIn(false);
    setUsername('');
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to CatsApp</h1>
        {isLoggedIn ? (
          <MainPage username={username} onLogout={handleLogout} /> // Renderuj MainPage po zalogowaniu
        ) : (
          <div>
            <Link to="/login">
              <button>Login</button>
            </Link>
            <Link to="/register">
              <button>Register</button>
            </Link>
          </div>
        )}
      </header>
    </div>
  );
}

export default App;
